message:
😳 Perseguição | “Precisamos combater a tríplice aliança do terço, da arma e do capital”, diz José Genoino (ex-guerrilheiro comunista).

🚩 A estratégia do governo Lula para combater os cristãos que denunciam o projeto de poder PTista.

🛑 Esquema revolucionário até chegar aos finalmentes: 

▪Adotar o plano de Gramsci; 

▪Governar através de conflitos democráticos;

▪Recriar o conceito de regime democrático e de nação;

▪Instaurar a redemocratização de controle público das instituições 
•PGR, 
•PF,
•AGU,
•CGU e
•FFAA;

▪Reformar os currículos militares;

▪Eliminar o artigo 142 da Constituição Federal;

▪Reorganizar o Exército sob comando político;

▪Impor a integração militar com os membros do Foro de São Paulo.

